import React from "react";
import { Progress, Row, Col } from "antd";

const ProgressBar = ({ i, length }) => {
	return (
		<>
			<div className="pagination">
				<h5>
					{i + 1}/{length}
				</h5>
				<Progress
					strokeColor="#108ee9"
					percent={((i + 1) / length) * 100}
					showInfo={false}
				></Progress>
			</div>
		</>
	);
};

export default ProgressBar;
